{
  "root": true,
  "parser": "@typescript-eslint/parser",
  "env": {
    "node": true
  },
  "ignorePatterns": ["**/*.ts"],
  "plugins": ["@typescript-eslint", "@nx"],
  "extends": ["plugin:storybook/recommended"],
  "rules": {
    "@typescript-eslint/explicit-module-boundary-types": "off",
    "no-restricted-imports": ["error", "create-nx-workspace"],
    "@typescript-eslint/no-restricted-imports": [
      "error",
      {
        "patterns": [
          {
            "group": ["nx/src/plugins/js*"],
            "message": "Imports from 'nx/src/plugins/js' are not allowed. Use '@nx/js' instead"
          },
          {
            "group": ["**/native-bindings", "**/native-bindings.js", ""],
            "message": "Direct imports from native-bindings.js are not allowed. Import from index.js instead."
          }
        ]
      }
    ],
    "storybook/no-uninstalled-addons": [
      "error",
      {
        "ignore": ["@nx/react/plugins/storybook"],
        "packageJsonLocation": "../../package.json"
      }
    ]
  },
  "overrides": [
    {
      "files": ["*.json"],
      "parser": "jsonc-eslint-parser",
      "rules": {}
    },
    {
      "files": ["**/executors/**/schema.json", "**/generators/**/schema.json"],
      "rules": {
        "@nx/workspace/valid-schema-description": "error"
      }
    },
    {
      "files": ["*.ts", "*.tsx", "*.js", "*.jsx"],
      "rules": {
        "@nx/enforce-module-boundaries": [
          "error",
          {
            "enforceBuildableLibDependency": true,
            "checkDynamicDependenciesExceptions": [".*"],
            "allow": [],
            "depConstraints": [
              {
                "sourceTag": "*",
                "onlyDependOnLibsWithTags": ["*"]
              }
            ]
          }
        ],
        "@nx/workspace/valid-command-object": "error"
      }
    },
    {
      "files": ["pnpm-lock.yaml"],
      "parser": "./tools/eslint-rules/raw-file-parser.js",
      "rules": {
        "@nx/workspace/ensure-pnpm-lock-version": [
          "error",
          {
            "version": "9.0"
          }
        ]
      }
    },
    {
      "files": ["*.ts"],
      "rules": {
        "@angular-eslint/prefer-standalone": "off"
      }
    }
  ]
}

{
  "singleQuote": true,
  "endOfLine": "lf",
  "plugins": ["prettier-plugin-tailwindcss"]
}

{
  "babelrcRoots": ["*"]
}

import { getJestProjectsAsync } from '@nx/jest';

export default async () => ({
  projects: await getJestProjectsAsync(),
});

// Ensure that the preset loads from node_modules rather than our local typescript source
const nxPreset = require('./node_modules/@nx/jest/preset').default;

module.exports = {
  ...nxPreset,
  testTimeout: 35000,
  testMatch: ['**/+(*.)+(spec|test).+(ts|js)?(x)'],
  transform: {
    '^.+\\.(ts|js|html)$': 'ts-jest',
  },
  resolver: '../../scripts/patched-jest-resolver.js',
  moduleFileExtensions: ['ts', 'js', 'html'],
  coverageReporters: ['html'],
  maxWorkers: 1,
  testEnvironment: 'node',
  setupFiles: ['../../scripts/unit-test-setup.js'],
};

{
  "$schema": "packages/nx/schemas/nx-schema.json",
  "namedInputs": {
    "default": ["{projectRoot}/**/*", "sharedGlobals"],
    "production": [
      "default",
      "!{projectRoot}/**/?(*.)+(spec|test).[jt]s?(x)?(.snap)",
      "!{projectRoot}/tsconfig.spec.json",
      "!{projectRoot}/jest.config.[jt]s",
      "!{projectRoot}/.eslintrc.json",
      "!{projectRoot}/.storybook/**/*",
      "!{projectRoot}/**/*.stories.@(js|jsx|ts|tsx|mdx)",
      "!{projectRoot}/tsconfig.storybook.json",
      "!{projectRoot}/src/test-setup.[jt]s"
    ],
    "sharedGlobals": [
      "{workspaceRoot}/babel.config.json",
      "{workspaceRoot}/.nx/workflows/agents.yaml",
      "{workspaceRoot}/.circleci/config.yml"
    ],
    "native": [
      "{projectRoot}/**/*.rs",
      "{projectRoot}/**/Cargo.*",
      {
        "runtime": "node -p '`${process.platform}_${process.arch}`'"
      },
      {
        "externalDependencies": ["npm:@monodon/rust", "npm:@napi-rs/cli"]
      }
    ],
    "e2eInputs": [
      "default",
      "{workspaceRoot}/jest.preset.js",
      "{workspaceRoot}/.verdaccio/config.yml",
      "{workspaceRoot}/scripts/local-registry/**/*",
      "{workspaceRoot}/scripts/nx-release.ts",
      {
        "env": "SELECTED_CLI"
      },
      {
        "env": "SELECTED_PM"
      },
      {
        "env": "NX_E2E_CI_CACHE_KEY"
      },
      {
        "env": "CI"
      },
      {
        "env": "NX_E2E_RUN_E2E"
      }
    ]
  },
  "release": {
    "projects": ["packages/*", "packages/nx/native-packages/*"],
    "releaseTagPattern": "{version}",
    "changelog": {
      "workspaceChangelog": {
        "createRelease": "github",
        "file": false
      },
      "git": {
        "commit": false,
        "stageChanges": false,
        "tag": false
      }
    },
    "version": {
      "generatorOptions": {
        "packageRoot": "build/packages/{projectName}",
        "currentVersionResolver": "registry",
        "skipLockFileUpdate": true
      },
      "git": {
        "commit": false,
        "stageChanges": false,
        "tag": false
      }
    }
  },
  "targetDefaults": {
    "nx-release-publish": {
      "options": {
        "packageRoot": "build/packages/{projectName}"
      }
    },
    "build": {
      "dependsOn": ["build-base", "build-native"],
      "inputs": ["production", "^production"],
      "cache": true
    },
    "build-native": {
      "inputs": ["native"],
      "cache": true
    },
    "build-base": {
      "dependsOn": ["^build-base", "build-native"],
      "inputs": ["production", "^production"],
      "executor": "@nx/js:tsc",
      "options": {
        "outputPath": "build/{projectRoot}",
        "tsConfig": "{projectRoot}/tsconfig.lib.json",
        "main": "{projectRoot}/index.ts"
      },
      "outputs": ["{options.outputPath}"],
      "cache": true
    },
    "test-native": {
      "inputs": ["native"],
      "executor": "@monodon/rust:test",
      "options": {},
      "cache": true
    },
    "test": {
      "dependsOn": ["test-native", "build-native", "^build-native"],
      "inputs": ["default", "^production", "{workspaceRoot}/jest.preset.js"],
      "options": {
        "args": ["--passWithNoTests", "--detectOpenHandles", "--forceExit"]
      }
    },
    "lint": {
      "dependsOn": [
        "build-native",
        "^build-native",
        "@nx/nx-source:lint-pnpm-lock"
      ]
    },
    "lint-pnpm-lock": {
      "cache": true
    },
    "e2e": {
      "cache": true,
      "inputs": ["e2eInputs", "^production"]
    },
    "e2e-local": {
      "cache": true,
      "inputs": ["e2eInputs", "^production"]
    },
    "e2e-ci": {
      "inputs": ["e2eInputs", "^production"]
    },
    "e2e-macos-local": {
      "cache": true,
      "inputs": ["e2eInputs", "^production"],
      "parallelism": false
    },
    "e2e-macos-ci": {
      "inputs": ["e2eInputs", "^production"]
    },
    "e2e-ci--**/**": {
      "inputs": ["e2eInputs", "^production"],
      "parallelism": false,
      "dependsOn": ["@nx/nx-source:populate-local-registry-storage"]
    },
    "e2e-macos-ci--**/*": {
      "inputs": ["e2eInputs", "^production"],
      "parallelism": false,
      "dependsOn": ["@nx/nx-source:populate-local-registry-storage"]
    },
    "e2e-base": {
      "inputs": ["default", "^production"]
    },
    "build-storybook": {
      "inputs": [
        "default",
        "^production",
        "{workspaceRoot}/.storybook/**/*",
        "{projectRoot}/.storybook/**/*",
        "{projectRoot}/tsconfig.storybook.json"
      ],
      "cache": true
    },
    "build-ng": {
      "cache": true
    },
    "sitemap": {
      "cache": true
    },
    "copy-docs": {
      "cache": true
    }
  },
  "plugins": [
    "@monodon/rust",
    {
      "plugin": "@nx/playwright/plugin",
      "options": {
        "targetName": "pw-e2e",
        "ciTargetName": "e2e-ci"
      }
    },
    {
      "plugin": "@nx/eslint/plugin",
      "exclude": ["packages/**/__fixtures__/**/*"],
      "options": {
        "targetName": "lint"
      }
    },
    {
      "plugin": "@nx/jest/plugin",
      "exclude": [
        "e2e/**/*",
        "packages/**/__fixtures__/**/*",
        "jest.config.ts"
      ],
      "options": {
        "targetName": "test"
      }
    },
    {
      "plugin": "@nx/webpack/plugin",
      "options": {
        "serveTargetName": "serve-base",
        "buildTargetName": "build-client"
      }
    },
    {
      "plugin": "@nx/jest/plugin",
      "include": ["e2e/**/*"],
      "exclude": ["e2e/detox/**/*", "e2e/react-native/**/*", "e2e/expo/**/*"],
      "options": {
        "targetName": "e2e-local",
        "ciTargetName": "e2e-ci"
      }
    },
    {
      "plugin": "@nx/jest/plugin",
      "include": ["e2e/detox/**/*", "e2e/react-native/**/*", "e2e/expo/**/*"],
      "options": {
        "targetName": "e2e-macos-local",
        "ciTargetName": "e2e-macos-ci"
      }
    },
    {
      "plugin": "@nx/next/plugin",
      "options": {
        "startTargetName": "next:start",
        "buildTargetName": "next:build",
        "devTargetName": "dev",
        "serveStaticTargetName": "serve-static"
      }
    },
    "@nx/powerpack-enterprise-cloud"
  ],
  "nxCloudId": "62d013ea0852fe0a2df74438",
  "nxCloudUrl": "https://staging.nx.app",
  "parallel": 1,
  "bust": 1,
  "defaultBase": "master",
  "conformance": {
    "rules": [
      {
        "rule": "@nx/workspace-plugin/conformance-rules/project-package-json",
        "projects": [
          "!.",
          "!create-nx-*",
          "!cypress",
          "!detox",
          "!devkit",
          "!esbuild",
          "!eslint-plugin",
          "!eslint",
          "!expo",
          "!express",
          "!jest",
          "!js",
          "!module-federation",
          "!nest",
          "!next",
          "!node",
          "!nuxt",
          "!packages/nx/**",
          "!plugin",
          "!react-native",
          "!react",
          "!rollup",
          "!rsbuild",
          "!rspack",
          "!storybook",
          "!vue",
          "!web",
          "!webpack",
          "!workspace"
        ]
      }
    ]
  }
}

{
  "name": "@nx/nx-source",
  "$schema": "node_modules/nx/schemas/project-schema.json",
  "targets": {
    "local-registry": {
      "executor": "@nx/js:verdaccio",
      "options": {
        "port": 4873,
        "config": ".verdaccio/config.yml",
        "storage": "build/local-registry/storage"
      }
    },
    "populate-local-registry-storage": {
      "cache": true,
      "inputs": [
        {
          "input": "production",
          "projects": ["tag:npm:public"]
        }
      ],
      "dependsOn": [
        {
          "target": "build",
          "projects": ["tag:npm:public"]
        }
      ],
      "command": "node ./scripts/local-registry/run-populate-storage.mjs",
      "outputs": ["{workspaceRoot}/build/local-registry/storage"]
    },
    "nx-release": {
      "dependsOn": [
        {
          "target": "build",
          "projects": ["tag:npm:public"]
        }
      ],
      "command": "ts-node -P ./scripts/tsconfig.release.json ./scripts/nx-release"
    }
  }
}
